import React from 'react'
import styled, {keyframes} from "styled-components";

const Container = styled.div`
    height:800px;
    width:800px;
    position:relative;
    font-size:98px;
    --X:132px;
    --Y:36px;
    background-color:var(--p-3);
`

const fadeIn = keyframes`
    0% {
        opacity: 0;
        transform: translateX(-50px);
    }
    100% {
        opacity: 1;
        transform: translateX(0px);
    }
`;

const Box = styled.div`
    height:.99em;
    width:.99em;
    position:absolute;
    border:solid 1px black;
`

const Box1 = styled(Box)`
    background-color:var(--p-7);
    transform:translateY(-1.63em) translateX(-.92em) skew(60deg) rotateX(60deg);
`

const Box2 = styled(Box)`
    background-color:var(--s-7);
    transform:translateY(-.92em) translateX(-.19em) skew(30deg) rotateX(30deg);
`

const Box3 = styled(Box)`
    background-color:var(--s-5);
    animation:${fadeIn} 2s ease-in-out;
`

const Box4 = styled(Box)`
    background-color:var(--s-3);
    transform:translateY(.94em) translateX(-.29em) skew(-30deg) rotateX(-30deg);
`
const Box5 = styled(Box)`
    background-color:var(--p-3);
    transform:translateY(1.63em) translateX(-.95em) skew(-60deg) rotateX(-60deg);
`

const Row = styled.div`
    top: 50%;
    left: 50%;
    position: absolute;

`
const Row1 = styled(Row)`
    transform:rotateZ(0deg) translateY(3em) translateX(3em);
`
const Row2 = styled(Row)`

    transform:rotateZ(-60deg) translateY(var(--Y)) translateX(var(--X));
`

const Row3 = styled(Row)`

    transform:rotateZ(-120deg) translateY(var(--Y)) translateX(var(--X));
`

const Row4 = styled(Row)`

    transform:rotateZ(-180deg) translateY(var(--Y)) translateX(var(--X));
`

const Row5 = styled(Row)`

    transform:rotateZ(-240deg) translateY(var(--Y)) translateX(var(--X));
`

const Row6 = styled(Row)`

    transform:rotateZ(-300deg) translateY(var(--Y)) translateX(var(--X));
`

export default function Figure() {
    return (
        <Container>
            <Row1>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row1>
            <Row2>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row2>
            <Row3>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row3>
            <Row4>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row4>
            <Row5>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row5>
            <Row6>
                <Box1/>
                <Box2/>
                <Box3/>
                <Box4/>
                <Box5/>
            </Row6>
        </Container>
    )
}
